import React from 'react'

const Navbar = () => {
  return (
    <nav className='nav'>
        <a href="/" className='site-title'>Site Name</a>
        <ul>
            <li><a href="/pricing" className='site-title'>Pricing</a></li>
            <li><a href="/about" className='site-title'>About</a></li>
        </ul>
    </nav>
  )
}

export default Navbar
